import React, { Component } from 'react';
import './App.css';
import Background from './components/background.js'
import Header from './components/header.js'

class App extends Component {
  render() {
      const image = 'https://images.pexels.com/photos/67636/rose-blue-flower-rose-blooms-67636.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260';

    return (
  <div className="App">
    <section id="background" style={{backgroundImage: `url(${image})`}}>
      <Background />
      <Header />
    </section>
      </div>
    );
  }
}

export default App;
